import React from "react";
import {
    VerticalTimeline,
    VerticalTimelineElement,
} from "react-vertical-timeline-component";
import "react-vertical-timeline-component/style.min.css";

const Experience = () => {
    return (
        <>
            <section className="header">
                <div className="container-fluid h-100">
                    <div className="row h-100">
                        <div className="col-12 mx-auto my-auto">
                            <h1 className="display-3 about_header text-center">
                                About Me
                            </h1>
                            <br />
                            <div style={{overflowY:"scroll", height:"400px"}}>
                                <VerticalTimeline>
                                    <VerticalTimelineElement
                                        className="vertical-timeline-element--work"
                                        // contentStyle={{
                                        //     background: "#32e0c4",
                                        //     color: "#fff",
                                        // }}
                                        // contentArrowStyle={{
                                        //     borderRight:
                                        //         "7px solid  #32e0c4",
                                        // }}
                                        date="2011 - present"
                                        iconStyle={{
                                            background: "#32e0c4",
                                            color: "#fff",
                                        }}
                                        
                                    >
                                        <h3 className="vertical-timeline-element-title">
                                            Creative Director
                                        </h3>
                                        <h4 className="vertical-timeline-element-subtitle">
                                            Miami, FL
                                        </h4>
                                        <p>
                                            Creative Direction, User Experience,
                                            Visual Design, Project Management,
                                            Team Leading
                                        </p>
                                    </VerticalTimelineElement>
                                    <VerticalTimelineElement
                                        className="vertical-timeline-element--work"
                                        date="2010 - 2011"
                                        iconStyle={{
                                            background: "#32e0c4",
                                            color: "#fff",
                                        }}
                                        
                                    >
                                        <h3 className="vertical-timeline-element-title">
                                            Art Director
                                        </h3>
                                        <h4 className="vertical-timeline-element-subtitle">
                                            San Francisco, CA
                                        </h4>
                                        <p>
                                            Creative Direction, User Experience,
                                            Visual Design, SEO, Online Marketing
                                        </p>
                                    </VerticalTimelineElement>
                                    <VerticalTimelineElement
                                        className="vertical-timeline-element--work"
                                        date="2008 - 2010"
                                        iconStyle={{
                                            background: "#32e0c4",
                                            color: "#fff",
                                        }}
                                        
                                    >
                                        <h3 className="vertical-timeline-element-title">
                                            Web Designer
                                        </h3>
                                        <h4 className="vertical-timeline-element-subtitle">
                                            Los Angeles, CA
                                        </h4>
                                        <p>User Experience, Visual Design</p>
                                    </VerticalTimelineElement>
                                    <VerticalTimelineElement
                                        className="vertical-timeline-element--work"
                                        date="2006 - 2008"
                                        iconStyle={{
                                            background: "#32e0c4",
                                            color: "#fff",
                                        }}
                                        
                                    >
                                        <h3 className="vertical-timeline-element-title">
                                            Web Designer
                                        </h3>
                                        <h4 className="vertical-timeline-element-subtitle">
                                            San Francisco, CA
                                        </h4>
                                        <p>User Experience, Visual Design</p>
                                    </VerticalTimelineElement>
                                </VerticalTimeline>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
        </>
    );
};

export default Experience;
